import withSpinner from '../with-spinner/with-spinner.component';
import { connect } from 'react-redux';
import BookingContent from './booking-content.component';
import { createStructuredSelector } from 'reselect';
import { selectIsLoadingBOOKING } from '../../redux/booking/booking-selector';


const mapStateToProps = createStructuredSelector({
    isLoading : selectIsLoadingBOOKING
})


const BookingContentContainer = connect(mapStateToProps,withSpinner(BookingContent))


export default BookingContentContainer;
